import React from "react";
import TillbakaSkarm from "./TillbakaSkarm";

function DeltagarSkarm({ navigation }) {
  return (
    <TillbakaSkarm navigation={navigation} text="Deltagare"></TillbakaSkarm>
  );
}

export default DeltagarSkarm;
